INSERT INTO `att_permission_types` VALUES (1,'Personal con goce de sueldo','Los funcionarios y empleados pueden solicitar un máximo de cinco días de licencia con goce de sueldo durante el año por motivos personales, los cuales se concederán siempre y cuando a juicio del jefe inmediato el goce de ellos no afecte la prestación del servicio. se concederán a discreción del jefe. Este permiso no podrá otorgarse previo o posterior a un período de vacación',2400,960,960,30,NULL,NULL,2,NULL,0,0,1,1,0,2,'2023-06-06 15:53:06','2023-09-27 19:31:08',NULL),(2,'Personal sin goce de sueldo','Los funcionarios y empleados pueden solicitar licencia sin goce de sueldo por motivos personales hasta un máximo de ocho días previa autorización del director de área, si excede este tiempo es requerida la autorización del Director General. Sujeto a juicio de la jefatura inmediata, siempre y cuando no se afecte la prestación del servicio. Este tipo de licencia no se abonará para fijar el tiempo de servicio del servidor público',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,1,1,0,12,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(3,'Duelo','Los funcionarios que atraviesen la perdida de un familiar cercano (Padre, madre, conyuge,  hijos) contaran con un permiso por tres días máximo con goce de sueldo; este permiso se respaldará con acta de defunción',NULL,NULL,1440,NULL,NULL,NULL,3,NULL,0,1,1,1,0,18,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(4,'Obligaciones de carácter público','Para atender doligencias de carácter público establecidas por la Ley u ordenadas por una autoridad competente.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,1,0,14,'2023-06-06 15:53:06','2024-02-06 15:41:45',NULL),(5,'Enfermedad de pariente','Para cumplir las obligaciones familiares que razonablemente reclamen su presencia como en los casos de enfermedad grave de su cónyuge o compañero (a) de vida, padres o hijos e hijas; requiere comprobante por parte de autoridad competente',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,1,0,11,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(6,'Matrimonio','Cuando el empleado contrajere matrimonio civil o religioso, a opción y petición formal del funcionario o servidor público, para concederle el permiso deberá presentar documento que acredite el acto, los días deberán ser gozados en el año calendario',2400,NULL,2400,NULL,1,NULL,5,NULL,0,1,1,1,0,17,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(7,'Incapacidad','Motivo de enfermedad o accidente común o de trabajo que imposibilite al servidor público desempeñar sus labores, siempre y cuando presente constancia médica de incapacidad extendida y/o avalada por la institución o médico competente',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,1,0,8,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(8,'Enfermedad sin certificado','El funcionario podrá gozar licencia por enfermedad sin incapacidad medica, hasta un máximo de 5 días acumulados en un mismo mes, sin que esta exceda de 15 días acumulados en un mismo año. El excedente se deducira del sueldo',7200,960,960,NULL,15,2,2,NULL,0,0,1,1,0,7,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(9,'Maternidad','Descanso pre y post-natal, hasta por un período de dieciséis semanas, dentro del cual estará comprendida la fecha del parto, de conformidad a lo establecido en este reglamento',53760,NULL,53760,NULL,1,NULL,112,NULL,0,1,1,1,0,15,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(10,'Misión oficial local','Entiendase como misión oficial toda actividad de trabajo que se realice fuera de la dependencia donde labora en territorio nacional; por ejemplo: reuniones de trabajo fuera de la instalación, capacitaciones, u otras actividades similares relacionadas con la institución',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,1,0,4,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(11,'Misión oficial Internacional','Entiendase como misión oficial toda actividad de trabajo que se realice en territorio internacional; por ejemplo: reuniones de trabajo, capacitaciones, conferencias u otras actividades similares relacionadas con la institución. Requiere autorización del Director General',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,1,0,10,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(12,'Problema de marcación','Se utilizará cuando el marcador no registre una de las marcaciones (entrada o salida). Esta modalidad podrá utilizarse hasta un máximo de tres veces en un mes.',NULL,NULL,480,NULL,NULL,3,1,NULL,0,1,1,1,0,3,'2023-06-06 15:53:06','2024-02-28 20:19:50',NULL),(13,'Hora de lactancia','La colaboradora podrá pactar con su jefe inmediato de comun acuerdo, una hora díaria de lactancia materna, pudiendo solicitarla al incio de la jornada o al fin de la misma, esta hora podrá fraccionarse en dos períodos de treina minutos, uno al inicio de la jornada y el otro al final',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,1,0,19,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(14,'Compensatorio','La licencia por tiempo compensatorio deben solicitarse con debida anticipación para no interrumpir con la actividad regular de la unidad, El día de descanso compensatorio no es acumulable, será remunerado con salario básico y deberá concederse en la misma semana laboral o, a más tardar, en la siguiente',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,1,0,6,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(15,'Paternidad','El personal tiene derecho a tres días de licencia en caso de paternidad por nacimiento o adopción; licencia que se concederá a elección del trabajador desde el día del nacimiento, de forma continua, o distribuidos dentro de los primeros quince días desde la fecha del nacimiento',1440,NULL,1440,NULL,3,NULL,3,NULL,0,0,1,1,0,16,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(16,'Suspención laboral','Se aplicará cuando el trabajador sea suspendido disciplinariamente conforme a lo regulado en el reglamento interno de la DGEHM',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,1,1,0,20,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(17,'Llegada tardía por fuerza mayor','Se utilizará exclusivamente por motivos de: Congestionamientos vehiculares inesperados tales como accidentes de transito agran escala, paro de transporte colectivo, cierre de calles inesperados, manifestaciones; de no cumplir con este requisito será rechazado',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,0,1,1,1,0,9,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(18,'Consulta medica de empleados e hijos ','Se utilizará cuando el trabajador ingrese posterior al horario establecido o se retire antes para asistir a una cita médica; requiere marcación ya sea anticipada o retrasada, podrá utilizarse para asistir a consulta médica de hijo e hija',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,1,0,5,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(19,'Permiso por estudio','A definir',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,1,0,13,'2023-06-06 15:53:06','2023-06-06 15:53:06',NULL),(20,'Llegada Tardía','El colaborador tiene un beneficio para justificar hasta 30 minutos al mes de llegadas tardías, los cuales podrán ser utilizados de forma parcial o total',360,30,30,NULL,NULL,NULL,NULL,45,0,1,1,1,0,1,'2023-09-19 14:24:22','2023-09-19 14:24:22',NULL),(21,'Atención de asuntos escolares','Será utilizado cuando el personal tenga que atender asuntos escolares de las hijas e hijos, para que puedan conciliar la actividad laboral con la actividad familiar.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,1,0,21,'2023-10-10 23:16:11','2023-10-10 23:16:11',NULL);
